import React from "react";
export default class userLogin extends React.Component {

    state = {inputValue: ''};

    handleChange = (event) => {
        this.setState({ inputValue: event.target.value})
    };

    render(){
        return(

            <form>
                <label></label>
                <input></input>
    
            </form>

        );

    }

}
